import React, { Component } from 'react';
import './App.css';
import RegistrationForm from './RegistrationForm';

import Backendless from 'backendless';

const APP_ID = process.env.REACT_APP_BACKENDLESS_APP_ID;
const API_KEY = process.env.REACT_APP_BACKENDLESS_SECRET_KEY;

Backendless.serverURL = 'https://eu-api.backendless.com';
Backendless.initApp(APP_ID, API_KEY);

const initialState = {
    loading: true,
    message: '',
    error  : null
}

class App extends Component {
    state = initialState

    render() {
        return (
            <div className="App">
                <h1>Ласкаво просимо на головну сторінку</h1>
                <RegistrationForm />
                <button onClick={() => alert('Натиснуто кнопку для реєстрації')}>Реєстрація</button>
            </div>
        );
    }
}

export default App;
